public class BurntheCandleatBothEnds : QuestClass
{
	public BurntheCandleatBothEnds()
	{
		Name = "Burn the Candle at Both Ends";
		QuestId.Add(40345);
		Step.AddRange(new[] { 1, 1, 1, 1, 1, 1, 1, 1 });
	}
	public override bool Pulse()
	{
		if (!Questing.ObjectiveComplete(this, 5))
		{
			Conditions.ForceIgnoreIsAttacked = true;
			if (!ObjectManager.Me.PlayerUsingVehicle)
			{
				var p = new Vector3(4959.039, 3779.34, 732.6066);
				Questing.Gather(p, 245340);
				return true;
			}
			if (Questing.ObjectiveComplete(this, 3) && !Questing.ObjectiveComplete(this, 4))
			{
				var obj = Questing.FindObject(243465);
				if (obj != null && obj.IsValid && obj.GetDistance < 10)
				{
					Interact.InteractGameObject(obj.GetBaseAddress);
					Thread.Sleep(Others.Random(1000, 2000));
				}
				return true;
			}
			var unit = Questing.FindUnit(99781, 99782);
			if (unit != null && unit.IsValid && unit.IsGoodInteractDistance)
			{
				Interact.InteractGameObject(unit.GetBaseAddress);
				Thread.Sleep(Others.Random(1000, 2000));
				Questing.Gossip(1);
			}
			return true;
		}
		Conditions.ForceIgnoreIsAttacked = false;
		if (ObjectManager.Me.PlayerUsingVehicle)
		{
			Usefuls.EjectVehicle();
			return true;
		}

		if (!Questing.ObjectiveComplete(this, 6))
		{
			var p = new Vector3(4937.702, 3805.764, 733.0316);
			GoToTask.ToPositionAndIntecractWithNpc(p, 99783, 1, false, null, true);
			return true;
		}
		if (!Questing.ObjectiveComplete(this, 7))
		{
			var p = new Vector3(4977.628, 3898.031, 729.7892);
			GoToTask.ToPositionAndIntecractWithNpc(p, 99784, 1);
			return true;
		}
		if (!Questing.ObjectiveComplete(this, 8))
		{
			var p = new Vector3(4974.663, 3898.847, 732.0211);
			Questing.Gather(p, 245357);
			return true;
		}
		return true;
	}
}

