public class NursingtheWounds : QuestClass
{
	List<Vector3> _hotspots = new List<Vector3>()
	{
		new Vector3(4676.615, 3877.472, 830.101),
		new Vector3(4777.842, 3896.039, 817.3372),
		new Vector3(4800.041, 3927.792, 829.0881),
	};
	public NursingtheWounds()
	{
		Name = "Nursing the Wounds";
		QuestId.Add(39318);
		Step.AddRange(new[] { 1, 8 });
	}
	public override bool Pulse()
	{
		if (!Questing.ObjectiveComplete(this, 1))
		{
			var p = new Vector3(4688.664, 3891.091, 830.9029);
			GoToTask.ToPositionAndIntecractWithNpc(p, 95403, 1, false, null, true);
			return true;
		}
		var fire = Questing.FindUnit(95261);
		if (fire != null && fire.IsValid)
		{
			if (fire.GetDistance > 29f)
			{
				GoToTask.ToPosition(fire.Position, 29f);
				return true;
			}
			MovementManager.Face(fire);
			Thread.Sleep(Usefuls.Latency * 2);
			if (Questing.UseExtraButton())
			{
				Thread.Sleep(Usefuls.Latency * 2);
				ClickOnTerrain.Pulse(fire.Position);
			}
			return true;
		}
		var p0 = _hotspots[Others.Random(0, _hotspots.Count - 1)];
		GoToTask.ToPosition(p0, 5f, false, (c) => {
			var f = Questing.FindUnit(95261);
			if (f != null && f.IsValid)
				return false;

			return true;
		});
		return true;
	}

	public override bool IsComplete()
	{
		return Questing.ObjectiveComplete(this, 2);
	}
}

