public class TheSkiesofHighmountain : QuestClass
{
	public TheSkiesofHighmountain()
	{
		Name = "The Skies of Highmountain";
		QuestId.Add(39387);
		Step.AddRange(new[] { 1, 1, 1 });
	}
	public override bool Pulse()
	{
		if (ObjectManager.Me.PlayerUsingVehicle)
			return true;

		var p = new Vector3(5121.456, 4461.573, 1021.617, "None");
		if (ObjectManager.Me.Position.DistanceTo(p) < 200)
		{
			GoToTask.ToPositionAndIntecractWithNpc(p, 98777);
			return true;
		}
		if (!Questing.ObjectiveComplete(this, 1))
		{
			var p1 = new Vector3(4192.526, 4406.968, 659.2631);
			GoToTask.ToPositionAndIntecractWithNpc(p1, 98773, 1);
			return true;
		}
		if (!Questing.ObjectiveComplete(this, 2))
		{
			var p2 = new Vector3(4085.01, 4385.548, 670.6269);
			GoToTask.ToPosition(p2);
		}
		return true;
	}
}

