public class IHaveaBadFeelingAboutThis : QuestClass
{
	public IHaveaBadFeelingAboutThis()
	{
		Name = "I Have a Bad Feeling About This";
		QuestId.Add(39873);
		Step.AddRange(new[] { 1 });
	}
	public override bool Pulse()
	{
		var p = new Vector3(5320.737, 4933.171, 693.3184);
		Questing.Gather(p, 244625);
		return true;
	}
	public override bool PickUp()
	{
		var p = new Vector3(5203.553, 4931.905, 710.1862, "None");
		Questing.PickUp(p, 97667, 6);
		return true;
	}
	public override bool TurnIn()
	{
		var p = new Vector3(5203.553, 4931.905, 710.1862, "None");
		if (Questing.Gather(p, 243402, 6))
		{
			Quest.CompleteQuest();
		}
		return base.TurnIn();
	}
	public override bool IsComplete()
	{
		return Questing.ObjectiveComplete(this, 1);
	}
}

